var portfolio=$("#portfolio");portfolio.slick({arrows:!1,dots:!0,speed:800,slidesToShow:2,slidesToScroll:2,responsive:[{breakpoint:768,settings:{speed:400,slidesToShow:1,slidesToScroll:1}}]}),$("#portfolio-arrow-prev").on("click",o=>{o.preventDefault(),portfolio.slick("slickPrev")}),$("#portfolio-arrow-next").on("click",o=>{o.preventDefault(),portfolio.slick("slickNext")});